text_show:
Des hot cross buns, ces petits pains briochés aux épices, j’en ai mangé à longueur d’année — on les achetait au regretté Marks & Spencer du boulevard Haussmann — avant de découvrir un beau matin qu’en fait, c’est une recette traditionnelle de Pâques que les anglais préparent et dégustent le Vendredi saint*. J’en ai fait quelques fois depuis cette révélation, mais cette année, au lieu d’utiliser la même recette, j’ai décidé de m’inspirer plutôt de celle de Dan Lepard, un expert de la boulangerie 
..........
) [facultatif, voir ci-dessous] - 340 g de farine (j'ai pris de la T55 bio) [si vous n'utilisez pas de levain, il en faut 400 g] - 1/2 c.c. de levure de boulanger déshydratée [si vous n'utilisez pas de levain, il en faut 2 c.c.] - 175 ml de lait, à température ambiante [si vous n'utilisez pas de levain, il en faut 225 ml], plus un peu pour badigeonner - 125 g de crème fraîche - 50 g de pistaches crues (non grillée et non salées), grossièrement hachées - 100 g de chocolat blanc de bonne qualité,
